import React from "react";
import styled, { css } from "styled-components";

const Input = ({ children }) => {
  return <Container>{children}</Container>;
};

const Container = styled.div`
  width: 300px;
  height: 60px;
  border-radius: 20px;
  border: 2px solid #e7ded0;
  padding-left: 22;
  align-items: center;
  display: flex;
`;

export default Input;
